import React, { Component } from "react";
import "../components/Portfolio.css";

import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
// import CardGroup from 'react-bootstrap/CardGroup';
// import image from '../../public/images';

export default class Porfolio extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <div>
        <span className="mywork">PROJECTS</span>
        <section id="portfolio">
          {/* <div className="row"> */}
            {/* <div className="twelve columns collapsed">
              <div
                id="portfolio-wrapper"
                className="bgrid-quarters s-bgrid-thirds cf"
              > */}
              <Row xs={1} md={2} className="g-3">
                {resumeData.portfolio &&
                  resumeData.portfolio.map((item) => {
                    return (
                      // <div className="columns portfolio-item">
                      <div>
                        {/* <div className="item-wrap"> */}

                        {/* <a href={`${item.link}`} target="_blank">
                      <img src={`${item.imgurl}`} className="img item-img"/>

                      <div className="overlay">
                        <div className="portfolio-item-meta">
                          <h5>{item.name}</h5>
                          <p>{item.description}</p>
                        </div>
                      </div>
                    </a> */}
                        {/* <h5>{item.name}</h5>
                          <p>{item.description}</p> */}
                        {/* <div className="portfolio-item-meta">
                          <h5>{item.name}</h5>
                          <p>{item.description}</p>
                        </div>       */}
                        <Col>
                        <Card style={{ width: "35rem" ,borderRadius: '30px', height:"420px"}} className="rounded">
                          <Card.Img style={{width:"35rem",height:"300px"}}variant="top" src={item.imgurl} />
                          <Card.Body>
                            <Card.Title>{item.name}</Card.Title>
                            <Card.Text style={{fontSize:"10px"}}>
                              {item.description}
                              {/* Some quick example text to build on the card title and make up the
                              bulk of the card's content. */}
                            </Card.Text>
                            <Card.Link href={item.link}>Github Repo</Card.Link>
                          </Card.Body>
                        </Card>

                          </Col>
                        {/* </div> */}
                      </div>
                    );
                  })}
                  </Row>
              {/* </div>
            </div> */}
          {/* </div> */}
        </section>
      </div>
    );
  }
}
